import React  from "react";
import { Link } from "react-router-dom";


export function NavMenuModule({types}){
    return(
        <React.StrictMode>
            <div>
            <nav>
            <ul>
                {
                    types.map(type => {
                        return(
                            <li>
                            {
                                <a href={type.title.href}>type.title.name</a>
                            }
                            </li>
                        )
                    })
                }
            </ul>
            </nav>
            </div>
        </React.StrictMode>
    )
}
